import { useEffect, useState } from 'react';

const get = async (url) => {
  const [responseData, setResponseData] = useState([]);
  useEffect(() => {
    (url, {
      dataType: 'json',
      headers: { 'Content-Type': 'application/json' },
      method: 'get',
    })
      .then((result) => result.json())
      .then((result) => result.results)
      .then((result) => {
        setResponseData(result);
        return responseData;
      });
  }, [url]);
};

export default get;
